import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Navbar extends Component {
  render() {
    return (
      // <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
      //   <Link to="/" className="navbar-brand">
      //     Show Recommender
      //   </Link>
      //   <div className="collpase navbar-collapse">
      //     <ul className="navbar-nav mr-auto">
      //       <li className="navbar-item">
      //         <Link to="/shows-list" className="nav-link">
      //           Show List
      //         </Link>
      //       </li>
      //       <li className="navbar-item">
      //         <Link to="/create-show" className="nav-link">
      //           Create Show
      //         </Link>
      //       </li>
      //       <li className="navbar-item">
      // <Link to="/user" className="nav-link">
      //   Create User
      // </Link>
      //       </li>
      //     </ul>
      //   </div>
      // </nav>

      <nav class="dt dt--fixed w-100 border-box pa3 ph5-ns bb b--black-10">
        <div class="dtc dn-ns w-third"></div>

        <div
          id="menu"
          class="static-ns absolute mt5 mt0-ns left-100 db dtc-ns v-mid w-50 w-100-ns w-75-ns h-80 tr"
        >
          <a
            class="link dim dark-gray tr tl-ns f3 f5-ns db dib-ns mr3 mr4-ns"
            href="#"
            title="Home"
          >
            <Link to="/"> Home</Link>
          </a>
          <a
            class="link dim dark-gray tr tl-ns f3 f5-ns db dib-ns mr3 mr4-ns"
            href="#"
            title="About"
          >
            <Link to="/create-show"> Add a Show</Link>
          </a>
          <a
            class="link dim dark-gray tr tl-ns f3 f5-ns db dib-ns mr3 mr0-ns"
            href="#"
            title="New"
          >
            <Link to="/user"> I'm new here!</Link>
          </a>
        </div>

        <a
          href="#"
          id="menu-btn"
          class="dtc tr v-mid dn-ns w-third pr2 p0-ns link dim dark-gray"
        >
          Menu
        </a>
      </nav>
    );
  }
}
